2',NULL,'habitat@berea.edu','Chase Ackerman',0,'The fourth event in the semester sub-programming that our team has done. This time we will be collaborating jointly with People Who Care for a small presentation, than a night of games and community building.',NULL,5),(188,'Habitat Homeless Shelter Trip',9,'10:00:00','16:00:00','Richmond, KY',0,1,1,0,'2023-04-01','2023-04-01',NULL,'habitat@berea.edu','Chase Ackerman',0,'Habitat invites you to join us this weekend in Richmond, KY for a day of repair work and organization at a local homeless shelter. This trip will include projects of various skill levels, some of which may include (though are not limited to):\r\n\r\n1) repair',NULL,5),(189,'Roaring 20s Party',9,'14:00:00','18:00:00','Irvine Nursing and Rehabilitation (Pick up from Alumni Circle)',0,1,1,0,'2023-04-23','2023-04-23',NULL,'agp@berea.edu','Aimee Ninahaza',0,'Whos ready to party? Join AGP as we bring the decade of parties to Irvine Nursing and Rehabilitation Facility at our Roaring 20s party! We plan to have an evening of fun with our residents with 20s-themed decorations, snacks, and games like dominos and Yahtzee. We will also have a jazz playlist to encourage our residents to dance. Dressing up is encouraged but not required.  ',NULL,1),(190,'Empty Bowls ',9,'17:30:00','19:00:00','Woods-Penn',0,0,1,0,'2023-03-30','2023-03-30',NULL,'celts@berea.edu','CELTS Admin',0,'Empty Bowls will take place at Berea College Woods-Penniman Commons on March 30th at 5:30 p.m. Tickets for the event will cost $15; in exchange, attendees will be served a bowl of soup with their choice of a ceramic bowl. The bowls are all handmade by Berea College ceramic students and the above mentioned local potters. All the event proceeds will go to the Berea Food Bank. Tickets may be purchased in the CELTS office (Stephenson 205) starting on Monday, March 27 through Wednesday, March 29, 9 a.m. to 11:30 a.m. and 1:30 to 4:30 p.m., in the Alumni Lounge noon to 1 p.m., Monday through Wednesday,  or at the event on Thursday. ',NULL,8),(191,'Easter Egg Hunt',9,'15:00:00','18:00:00','Irvine Nursing and Rehabilitation (Pick up from Alumni Circle)',0,1,1,0,'2023-04-06','2023-04-06',NULL,'agp@berea.edu','Aimee Ninahaza',0,'Join us this Thursday for a fun Easter Egg Hunt with our lovely Irvine Nursing and Rehabilitation residents.\r\n\r\nWe\'ll all be delighted to have you around!',NULL,1),(192,'Habitat Connect #5',9,'18:00:00','19:00:00','CELTS Arts & Crafts',0,1,1,0,'2023-04-05','2023-04-05',NULL,'habitat@berea.edu','Chase Ackerman',0,'Join the Habitat team for a Wednesday evening of chill crafts and community building. \r\n\r\nPlease invite your friends!',NULL,5),(193,'AGP Volunteer Opportunity - Dominion Senior Living  Week 1',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-04','2022-10-04',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1),(194,'AGP Volunteer Opportunity - Dominion Senior Living  Week 2',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-11','2022-10-11',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1),(195,'AGP Volunteer Opportunity - Dominion Senior Living  Week 3',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-18','2022-10-18',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1),(196,'AGP Volunteer Opportunity - Dominion Senior Living  Week 4',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-25','2022-10-25',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1),(197,'AGP Volunteer Opportunity - Dominion Senior Living  Week 1',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-05','2022-10-05',15,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1),(198,'AGP Volunteer Opportunity - Dominion Senior Living  Week 2',9,'1