INSERT INTO `program` VALUES (1,'Adopt-a-Grandparent',NULL,1,0,'Aimee Ninahaza','agp@berea.edu','Adopt-a-Grandparent (AGP) is an outreach program for Berea elders. The program matches college student volunteers with residents of local long-term care centers. Volunteers visit with residents for at least an hour per week, and participate in special monthly programs.',NULL,'https://www.berea.edu/celts/community-service-programs/volunteer-opportunities/adopt-a-grandparent-program/'),(2,'Berea Buddies',NULL,1,0,'Wilmer Ortiz Perez','bereabuddies@berea.edu','The Berea Buddies program is dedicated to establishing long-term mentorships between Berea youth (Little Buddies) and Berea College students (Big Buddies). Volunteers serve children by offering them friendship and quality time. Big and Little Buddies meet each other every Monday or Tuesday during the academic year, except on school and national holidays, to enjoy structured activities around campus.',NULL,'https://www.berea.edu/celts/community-service-programs/volunteer-opportunities/berea-buddies-program/'),(3,'Berea Teen Mentoring',NULL,1,0,'Leslie Bell','bereateenmentoring@berea.edu','Berea Teen Mentoring (BTM) brings Berea community youth, from ages 13-18, into a group setting for mentorship and enrichment programs. Staff members are assisted during the weekly program by Berea College student volunteers, who act as mentors for these program participants. The mission of the program is to stimulate and cultivate personal growth for young adults in the Berea community.',NULL,'https://www.berea.edu/celts/community-service-programs/volunteer-opportunities/teen-mentoring-program/'),(4,'Berea Tutoring',NULL,1,0,'Fay Moore','bereatutoring@berea.edu','Berea Tutoring provides an encouraging atmosphere for local students who need help in achieving academic success, and for college volunteers who want to learn more about teaching or volunteering. Our mission is to increase conceptual understanding in academic subject areas, enrich educational experiences, and build self-confidence by providing college-aged tutors to local school children.','','https://www.berea.edu/celts/community-service-programs/volunteer-opportunities/berea-tutoring-program/'),(5,'Habitat for Humanity',NULL,1,0,'Chase Ackerman','habitat@berea.edu','Through the work of Habitat for Humanity International, thousands of low-income families have found hope through affordable housing. Hard work and volunteering have resulted in the organization sheltering more than two million people worldwide.',NULL,'https://www.berea.edu/celts/community-service-programs/volunteer-opportunities/habitat-for-humanity-program/'),(6,'Hispanic Outreach Program',NULL,1,0,'Sabdi Lopez Jimenez','hop@berea.edu','The Hispanic Outreach Program (HOP) is a service-learning effort which brings together CELTS, several community organizations, and the Department of Foreign Languages at Berea College. HOP aims to build bridges among the Spanish-speaking and English-speaking residents of Madison County.',NULL,'https://www.berea.edu/celts/community-service-programs/volunteer-opportunities/hispanic-outreach-project/'),(7,'People Who Care',NULL,1,0,'Maryam Al Tatooz','pwc@berea.edu','People Who Care (PWC) helps to connect Berea College students with organizations and opportunities that promote change through advocacy, education, action, and direct community service. Volunteers may serve at local shelters, work with the Fair Trade University Campaign, or help to raise awareness about local issues like domestic violence, homelessness, fair trade, and AIDS awareness education. Students are welcome to participate as volunteers in PWCs projects.',NULL,'https://www.berea.edu/celts/community-service-programs/volunteer-opportunities/people-who-care-program/'),(8,'Hunger Initiatives',NULL,0,0,'','','Each year 200 people stand in line to get into Woods-Penniman for the Annual Empty Bowls Event sponsored by the Berea College ceramics students and CELTS. Students, faculty, staff and community members each pay $10 for a beautiful bowl, soup and the privilege of helping those in need in our community.',NULL,'https://www.berea.edu/celts/community-service-programs/hunger-initiatives/'),(10,'Bonner Scholars',NULL,0,1,'','','The Bonner Scholars Program is a unique opportunity for students who want to combine a strong commitment to service with personal growth, teamwork, leadership development, and scholarship. Students who have completed an application for the Berea College class of 2026 may apply to be a Bonner Scholar.','','https://www.berea.edu/celts/bonner-scholars-program/');
/*!40000 ALTER TABLE `program` ENABLE KEYS */;
UNLOCK TABLES;

